import React, { useEffect, useState } from 'react'
import '../styles.css'
import EventIcon from '@mui/icons-material/Event'
import EventAvailableIcon from '@mui/icons-material/EventAvailable'
import EventBusyIcon from '@mui/icons-material/EventBusy'
import { fetchStaticAllExperiencesFromAPI } from '../../api/StaticData'
import ChooseCharts from '../chooseCharts/ChooseCharts'

const OverviewPage = () => {
  const [expData, setExpData] = useState([])
  const [boxPlotData, setBoxPlotData] = useState({})
  const [wordCloudData, setWordCloudData] = useState({})
  const [timeLineData, setTimeLineData] = useState({})
  const [sunburstData, setSunburstData] = useState({})
  const [sunburstLabel, setSunburstLabel] = useState({})
  const [eventTypeColor, setEventTypeColor] = useState({})

  const handleDataReceived = (data) => {
    console.log('Dados recebidos:', data)
    setBoxPlotData(data)
  }

  const handleWordDataReceived = (data) => {
    setWordCloudData(data)
  }

  const handleTimeLineDataReceived = (data) => {
    setTimeLineData(data)
  }

  const handleEventTypeColor = (data) => {
    setEventTypeColor(data)
  }

  const handleSunburstDataReceived = (data) => {
    setSunburstData(data)
  }

  const handleSunburstLabelReceived = (data) => {
    setSunburstLabel(data)
  }

  useEffect(() => {
    const fetchExpData = async () => {
      try {
        const fetchedData = await fetchStaticAllExperiencesFromAPI()
        setExpData(fetchedData)
      } catch (error) {
        console.error('Error fetching word cloud data:', error)
      }
    }

    fetchExpData()
  }, [])

  return (
    <div className="container-fluid" style={{ paddingTop: '20px' }}>
      <div className="row">
        <div className="col-md-8">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#13678A',
            }}
          >
            <ChooseCharts
              title={'In-Depth Data Analysis'}
              showTimeline
              boxPlotData={boxPlotData}
              wordCloudData={wordCloudData}
              timeLineData={timeLineData}
              sunburstData={sunburstData}
              sunburstLabel={sunburstLabel}
              eventTypeColor={eventTypeColor}
              onDataReceived={handleDataReceived}
              onWordDataReceived={handleWordDataReceived}
              onTimeLineDataReceived={handleTimeLineDataReceived}
              onEventTypeColor={handleEventTypeColor}
              onSunburstDataReceived={handleSunburstDataReceived}
              onSunburstLabelReceived={handleSunburstLabelReceived}
            />
          </div>
        </div>
        <div
          className="col-md-4"
          style={{ display: 'flex', justifyContent: 'flex-end' }}
        >
          <div className="flex-column">
            <div className="d-flex justify-content-between">
              <div
                className="first-div"
                style={{
                  height: '200px',
                  width: '200px',
                  padding: '30px',
                  marginInline: '10px',
                  marginBottom: '20px',
                  background: '#13678A',
                }}
              >
                <h2
                  style={{
                    fontFamily: 'Arial, sans-serif',
                    fontSize: '24px',
                    fontWeight: 'bold',
                    color: '#333',
                    marginBottom: '10px',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  Total Experiences
                </h2>
                <div
                  style={{
                    border: '2px solid black',
                    borderRadius: '10px',
                    padding: '10px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  <EventIcon
                    fontSize={'large'}
                    style={{ marginRight: '10px' }}
                  />
                  {expData && <h3>{expData.total_experiences}</h3>}
                </div>
              </div>
              <div
                className="first-div"
                style={{
                  height: '200px',
                  width: '200px',
                  padding: '30px',
                  marginInline: '10px',
                  marginBottom: '20px',
                  background: '#13678A',
                }}
              >
                <h2
                  style={{
                    fontFamily: 'Arial, sans-serif',
                    fontSize: '24px',
                    fontWeight: 'bold',
                    color: '#333',
                    marginBottom: '10px',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  Successful Experiences
                </h2>
                <div
                  style={{
                    border: '2px solid black',
                    borderRadius: '10px',
                    padding: '10px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  <EventAvailableIcon
                    fontSize={'large'}
                    style={{ marginRight: '10px' }}
                  />
                  {expData && <h3>{expData.successful_experiences}</h3>}
                </div>
              </div>
              <div
                className="first-div"
                style={{
                  height: '200px',
                  width: '200px',
                  padding: '30px',
                  marginInline: '10px',
                  marginBottom: '20px',
                  background: '#13678A',
                }}
              >
                <h2
                  style={{
                    fontFamily: 'Arial, sans-serif',
                    fontSize: '24px',
                    fontWeight: 'bold',
                    color: '#333',
                    marginBottom: '10px',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  Error Experiences
                </h2>
                <div
                  style={{
                    border: '2px solid black',
                    borderRadius: '10px',
                    padding: '10px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  <EventBusyIcon
                    fontSize={'large'}
                    style={{ marginRight: '10px' }}
                  />
                  {expData && <h3>{expData.error_experiences}</h3>}
                </div>
              </div>
            </div>
            <div
              className="first-div"
              style={{
                width: '100%',
                background: '#13678A',
                alignItems: 'center',
                justifyContent: 'center',
                textAlign: 'center',
                height: '200px',
                marginTop: '20px',
              }}
            >
              <h2>
                Pensar o que poderei colocar aqui! Talvez informação dos
                participantes!
              </h2>
            </div>
          </div>
        </div>
      </div>
      <div
        className="row"
        style={{ display: 'flex', justifyContent: 'center' }}
      >
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#13678A',
              alignItems: 'center',
              justifyContent: 'center',
              textAlign: 'center',
            }}
          >
            <ChooseCharts title={'In-Depth Data Analysis'} showChart />
          </div>
        </div>
        <div className="col-md-4" style={{ height: '640px' }}>
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#13678A',
              alignItems: 'center',
              justifyContent: 'center',
              textAlign: 'center',
            }}
          >
            <ChooseCharts title={' Data Distribution'} showChart />
          </div>
        </div>
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#13678A',
              alignItems: 'center',
              justifyContent: 'center',
              textAlign: 'center',
            }}
          >
            <ChooseCharts title={'Word Distribution'} showChart />
          </div>
        </div>
      </div>
    </div>
  )
}

export default OverviewPage
